It's a time for guilty pleasures, for courtship, for declarations of love, for looking someone in
the eye and whispering sweet nothings, accompanied by a compilation of some of the
greatest and squishiest love songs from the likes of Celine Dion, Joe Cocker and Jennifer
Warnes, Jason and Kylie, 10cc and Lionel Richie, all from the Top of the Pops era. If Hot
Chocolate and Chaka Khan don't get the temperatures rising, then nothing will...

